import React from 'react'
import pic1 from '../assets/products/model-1-1.jpg'
import pic2 from '../assets/products/model-1-2.jpg'
import {
    FiShoppingCart,
    FiHeart,
  } from "react-icons/fi";

  
export function Product(props) {
    return (
        <div className="product-container">
            <div className='image-container'>
            <img src={pic1} />
            </div>
            <p className='product-name'>Tshirt</p>
            <p className='product-price'>Rs.500</p>
            <div className='shop-cart'><span className='icon'><FiHeart/></span><span>Add To Cart</span></div>
            <div className='shop-cart'><span className='icon'><FiShoppingCart/></span> Add To Wishlist</div>
        </div>
    )
}
